import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Typography,
  Grid,
  Card,
  CardContent,
  Box,
} from "@mui/material";

export default function AccountsList({ searchValue = "" }) {
  const [accounts, setAccounts] = useState([]);
  const [filteredAccounts, setFilteredAccounts] = useState([]);
  const navigate = useNavigate();

  useEffect(() => {
    fetch("http://localhost:8000/accounts")
      .then((res) => res.json())
      .then((data) => {
        setAccounts(data);
        setFilteredAccounts(data); // initial full list
      })
      .catch((err) => console.error("Failed to fetch accounts:", err));
  }, []);

  // Real-time filtering on searchValue change
  useEffect(() => {
    if (!searchValue.trim()) {
      setFilteredAccounts(accounts);
      return;
    }

    const lowerSearch = searchValue.toLowerCase().trim();

    const results = accounts.filter((acc) =>
      acc.name?.toLowerCase().includes(lowerSearch)
    );

    setFilteredAccounts(results);
  }, [searchValue, accounts]);

  // Calculate totals based on ALL accounts (not filtered)
  const totalAccounts = accounts.length;
  const totalQuotedCost = accounts.reduce(
    (sum, acc) => sum + (parseFloat(acc.quoted_cost) || 0),
    0
  );

  return (
    <>
      <Typography variant="h4" gutterBottom>
        AWS Cost Dashboard - Accounts Overview
      </Typography>

      {/* Summary Cards – always show totals of ALL accounts */}
      <Grid container spacing={3} sx={{ mb: 5 }}>
        <Grid item xs={12} sm={6} md={6}>
          <Card elevation={3} sx={{ height: "100%", bgcolor: "#e3f2fd" }}>
            <CardContent sx={{ textAlign: "center" }}>
              <Typography variant="subtitle2" color="text.secondary" gutterBottom>
                Total Accounts
              </Typography>
              <Typography variant="h4" fontWeight="bold" color="primary.main">
                {totalAccounts}
              </Typography>
            </CardContent>
          </Card>
        </Grid>

        <Grid item xs={12} sm={6} md={6}>
          <Card elevation={3} sx={{ height: "100%", bgcolor: "#e8f5e9" }}>
            <CardContent sx={{ textAlign: "center" }}>
              <Typography variant="subtitle2" color="text.secondary" gutterBottom>
                Total Quoted Cost
              </Typography>
              <Typography variant="h4" fontWeight="bold" color="success.dark">
                ${totalQuotedCost.toFixed(2)}
              </Typography>
            </CardContent>
          </Card>
        </Grid>
      </Grid>

      {/* Accounts Table – shows filtered results */}
      <Typography variant="h5" gutterBottom sx={{ mb: 2 }}>
        All Accounts
        {searchValue.trim() && (
          <Typography component="span" variant="body2" color="text.secondary" sx={{ ml: 2 }}>
            (filtered: {filteredAccounts.length} shown)
          </Typography>
        )}
      </Typography>

      <TableContainer component={Paper} elevation={2}>
        <Table>
          <TableHead>
            <TableRow sx={{ bgcolor: "#f5f5f5" }}>
              <TableCell>
                <strong>Account Name</strong>
              </TableCell>
              <TableCell>
                <strong>Quoted Cost</strong>
              </TableCell>
              <TableCell>
                <strong>Onboard Date</strong>
              </TableCell>
            </TableRow>
          </TableHead>

          <TableBody>
            {filteredAccounts.length === 0 ? (
              <TableRow>
                <TableCell colSpan={3} align="center" sx={{ py: 4 }}>
                  <Typography color="text.secondary">
                    {searchValue.trim()
                      ? "No accounts match your search"
                      : "No accounts found"}
                  </Typography>
                </TableCell>
              </TableRow>
            ) : (
              filteredAccounts.map((acc) => (
                <TableRow
                  key={acc.account_id}
                  hover
                  sx={{ cursor: "pointer" }}
                  onClick={() => navigate(`/accounts/${acc.account_id}`)}
                >
                  <TableCell>{acc.name}</TableCell>
                  <TableCell>${parseFloat(acc.quoted_cost || 0).toFixed(2)}</TableCell>
                  <TableCell>{acc.onboard_date}</TableCell>
                </TableRow>
              ))
            )}
          </TableBody>
        </Table>
      </TableContainer>
    </>
  );
}
